%[text] ## 1.1 Simulation of a Bouncing Ball
%[text] 
%[text] A bouncing ball model is an example of a hybrid dynamic system. A hybrid dynamic system is a system that involves both continuous dynamics and discrete transitions where the system dynamics can change and the state values can jump. The continuous dynamics of a bouncing ball are given by these equations:
%[text] (1) $\\frac{\\textrm{dv}}{\\;\\textrm{dt}\\;}=-g\\;,${"editStyle":"visual"}
%[text] (2) $\\frac{\\textrm{dx}}{\\textrm{dt}}=v${"editStyle":"visual"},
%[text] where $g\\;${"editStyle":"visual"}is the acceleration due to gravity, $x\\left(t\\right)${"editStyle":"visual"} is the position of the ball, and $v\\left(t\\right)${"editStyle":"visual"} is the velocity. The system has two continuous states: the position $x${"editStyle":"visual"} and the velocity $v${"editStyle":"visual"}.
%[text] The hybrid system aspect of the model originates from the modeling of a collision of the ball with the ground. If one assumes a partially elastic collision with the ground, then the velocity before the collision, $v^-${"editStyle":"visual"}, and velocity after the collision, $v^+${"editStyle":"visual"}, can be related by the coefficient of restitution of the ball, $\\kappa${"editStyle":"visual"}, as follows:
%[text] $v^+ =-\\kappa v^- ,\\;x=0${"editStyle":"visual"}
%[text] The bouncing ball therefore displays a jump in a continuous state (velocity) at the transition condition, $x=0${"editStyle":"visual"}. The image shows a ball throw up with a velocity of 0 m/s from a height of 25 m.
%[text] ![](text:image:2c63)
%%
%[text] ### 1.1.1 First-Order Integrators
%[text] 
%[text] In the following steps we are going to familiarize ourselfs with the Simulink Library Browser and some of its elements by modelling a bouncing ball using two integrator blocks. To open the Simulink model run this code section below:
load_system('BouncingBall')              
open_system('BouncingBall','tab')
%[text] The first integrator we will use describes the velocity equation (1). Open the BouncingBall.slx file and search for "Integrator" in the Library Browser of the "Simulation" menu. Drag in the element onto the blank canvas, double click on it and copy the following settings:
%[text] ![](text:image:9fd4)
%[text] Next we add the following blocks from the Library Browser: Initial Condition, Constant and Gain. After connecting them in the right place it should look like this: 
%[text] ![](text:image:3e3d)
%[text] We will repeat a similar process for the position equation and connect everything together into one system with two integrators. Make sure to copy the following settings into the second integrator as we have to set saturation limits for the ball position:
%[text] ![](text:image:33fd)
%[text] After adding additional CompareToZero, Terminator and Ground blocks to the system it should look like the picture below. To add Scopes to the system right click on the velocity connection and select "Connect To Viewer" then "Simulink" and finally "Scope". Repeat this for the positon too.
%[text] ![](text:image:799f)
%[text] To observe the Zeno behavior of the system, modify solver configuration parameters.
%[text] 1. To open the Configuration Parameters dialog box, on the **Modeling** tab, under **Setup**, click **Model Settings**.
%[text] 2. Select the **Solver** pane.
%[text] 3. Set the **Stop time** to `25`.
%[text] 4. Click the arrow next to **Solver details** to view additional solver parameters.
%[text] 5. Under **Zero-crossing options**, set **Algorithm** to `Nonadaptive`. \
%[text] Run the simulation and look at the scopes. What do you see? How does this system work? Show your plots to the TA and answer the questions.
%%
%[text] ### 1.1.2 Second-Order Integrator
%[text] 
%[text] In the next step you should use the Second-Order Integrator Block and try to figure out how to get the same scope plots that you received using two First-Order Integrators. Use the same Simulink Model and the settings from the picture below. TIPP: Use a "Memory" block from the Library Browser. Think about why we need this element (check out: [https://ch.mathworks.com/help/simulink/ug/algebraic-loops.html](https://ch.mathworks.com/help/simulink/ug/algebraic-loops.html)).
